-- Gegnertabellen neu
CREATE TABLE [Gegner] (
	[GegnerGUID] uniqueidentifier NOT NULL DEFAULT newid(), 
	[Name] nvarchar(100) NOT NULL, 
	[Bild] nvarchar(500), 
	[INIBasis] int NOT NULL DEFAULT 0, 
	[INIZufall] nvarchar(10) NOT NULL DEFAULT '1W6', 
	[Aktionen] int NOT NULL DEFAULT 2, 
	[PA] int NOT NULL DEFAULT 0, 
	[LE] int NOT NULL DEFAULT 0, 
	[AU] int NOT NULL DEFAULT 0, 
	[AE] int NOT NULL DEFAULT 0, 
	[KE] int NOT NULL DEFAULT 0, 
	[KO] int NOT NULL DEFAULT 0, 
	[MRGeist] int NOT NULL DEFAULT 0, 
	[MRKörper] int, 
	[GS] int NOT NULL DEFAULT 8, 
	[GS2] int, 
	[GS3] int, 
	[RSKopf] int NOT NULL DEFAULT 0, 
	[RSBrust] int NOT NULL DEFAULT 0, 
	[RSRücken] int NOT NULL DEFAULT 0, 
	[RSArmL] int NOT NULL DEFAULT 0, 
	[RSArmR] int NOT NULL DEFAULT 0, 
	[RSBauch] int NOT NULL DEFAULT 0, 
	[RSBeinL] int NOT NULL DEFAULT 0, 
	[RSBeinR] int NOT NULL DEFAULT 0, 
	[GW] int, 
	[Jagd] int, 
	[Beschwörung] int, 
	[Kontrolle] int, 
	[Beschwörungskosten] int, 
	[Tags] nvarchar(1000), 
	[Bemerkung] ntext, 
	[Literatur] nvarchar(300), 
	[Setting] nvarchar(100),
	CONSTRAINT [PK_Gegner] PRIMARY KEY ([GegnerGUID])
)
GO
CREATE TABLE [Kampfregel] (
	[KampfregelGUID] uniqueidentifier NOT NULL DEFAULT newid(), 
	[Name] nvarchar(100) NOT NULL, 
	[Manöver] bit NOT NULL DEFAULT 0,
	[Bemerkung] ntext, 
	[Literatur] nvarchar(300),
	CONSTRAINT [PK_Kampfregel] PRIMARY KEY ([KampfregelGUID])
)
GO

CREATE TABLE [Gegner_Angriff] (
	[GegnerGUID] uniqueidentifier NOT NULL DEFAULT '00000000-0000-0000-0000-000000000000', 
	[Name] nvarchar(100) NOT NULL, 
	[TPWürfel] int NOT NULL DEFAULT 6, 
	[TPWürfelAnzahl] int NOT NULL DEFAULT 1, 
	[TPBonus] int NOT NULL DEFAULT 0, 
	[AT] int NOT NULL DEFAULT 0, 
	[DK] nvarchar(4), 
	[Reichweite] int, 
	[Bemerkung] ntext,
	CONSTRAINT [PK_Gegner_Angriff] PRIMARY KEY ([GegnerGUID], [Name]),
	CONSTRAINT fk_GegnerAngriff_Gegner FOREIGN KEY ([GegnerGUID])
		REFERENCES Gegner ([GegnerGUID])
		ON UPDATE CASCADE ON DELETE CASCADE
)
GO

CREATE TABLE [Gegner_Kampfregel] (
	[GegnerGUID] uniqueidentifier NOT NULL DEFAULT '00000000-0000-0000-0000-000000000000', 
	[KampfregelGUID] uniqueidentifier NOT NULL DEFAULT '00000000-0000-0000-0000-000000000000',
	[Erschwernis] int NOT NULL DEFAULT 0,
	[TP] nvarchar(10) NULL ,
	[Bemerkung] ntext,
	CONSTRAINT [PK_Gegner_Kampfregel] PRIMARY KEY ([GegnerGUID], [KampfregelGUID]),
	CONSTRAINT fk_GegnerKampfregel_Gegner FOREIGN KEY ([GegnerGUID])
		REFERENCES Gegner ([GegnerGUID])
		ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT fk_GegnerKampfregel_Kampfregel FOREIGN KEY ([KampfregelGUID])
		REFERENCES [Kampfregel] ([KampfregelGUID])
		ON UPDATE CASCADE ON DELETE CASCADE
)
GO

-- Farbtabellen neu
CREATE TABLE [Farbe] (
	[FarbeID] bigint NOT NULL IDENTITY, 
	[Name] nvarchar(30) NOT NULL,
	CONSTRAINT [PK_Farbe] PRIMARY KEY ([FarbeID])
)
GO

CREATE TABLE [Rasse_Farbe] (
	[RasseGUID] uniqueidentifier NOT NULL DEFAULT '00000000-0000-0000-0000-000000000000', 
	[FarbeID] bigint NOT NULL, 
	[Kategorie] nvarchar(10) NOT NULL DEFAULT 'Haare', 
	[W20] int NOT NULL DEFAULT 1,
	CONSTRAINT [PK_Rasse_Farbe] PRIMARY KEY ([RasseGUID], [FarbeID], [Kategorie]),
	CONSTRAINT fk_RasseFarbe_Rasse FOREIGN KEY ([RasseGUID])
		REFERENCES Rasse ([RasseGUID])
		ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT fk_RasseFarbe_Farbe FOREIGN KEY ([FarbeID])
		REFERENCES Farbe ([FarbeID])
		ON UPDATE CASCADE ON DELETE CASCADE
)
GO

